import React, { Component } from "react";
import "./searcher.css";
class Searcher extends Component {
  render() {
    return (
      <section className="searcher_container">
        <div className="left_filter"></div>
        <MyForm />
      </section>
    );
  }
}
class MyForm extends Component {
  render() {
    return (
      <form>
        <input></input>
      </form>
    );
  }
}
export default Searcher;
